const INITIAL_STATE = {
  sections: [
    {
      title: 'hats',
      imageUrl: 'https://thumblr.uniid.it/product/207929/53c57f256bce.jpg',
      id: 1,
      linkUrl: 'shop/hats'
    },
    {
      title: 'jackets',
      imageUrl: 'https://thumblr.uniid.it/product/210017/360f028e205b.jpg',
      id: 2,
      linkUrl: 'shop/jackets'
    },
    {
      title: 'shoes',
      imageUrl: 'https://thumblr.uniid.it/product/217103/329dd9987986.jpg',
      id: 3,
      linkUrl: 'shop/shoes'
    },
    {
      title: 'women',
      imageUrl: 'https://thumblr.uniid.it/product/215313/739ae44d3c97.jpg',
      size: 'large',
      id: 4,
      linkUrl: 'shop/women'
    },
    {
      title: 'men',
      imageUrl:
        'https://thumblr.uniid.it/product/200783/7b5367879c5b.jpg',
      size: 'large',
      id: 5,
      linkUrl: 'shop/men'
    }
  ]
};

const directoryReducer = (state = INITIAL_STATE, action) => {
  switch (action.type) {
    default:
      return state;
  }
};

export default directoryReducer;
